import React, { Component } from 'react'; 
import Testingdatasets from './Testingdatasets'; 
class Data extends Component{ 
    constructor(props){ 
        super(props); 
        this.state = { 
            username:'', 
            password:''
          }
    } 

    render(){  
        let users = this.state.users.map(u => <Testingdatasets name={u.name}/>)
        return( 
            <ul> 
                {users}
            </ul>
        );
    }
} 
export default Data;
